import React from "react";
import Logo from "../../images/logo.png";
import styles from "./Navbar.module.css";

const Navbar = () => {
  return (
    <div className={styles.container}>
      <div className={styles.logo}>
        <img src={Logo} alt={Logo} />
      </div>
      <div className={styles.navLinkContainer}>
        <span className={styles.navLinks}>Home</span>
        <span className={styles.navLinks}>Portfolio</span>
        <span className={styles.projectLink}>Start A Project</span>
      </div>
      <div className={styles.toggleNavbar}>
        <div className={styles.toggler}></div>
        <div className={styles.toggler}></div>
        <div className={styles.toggler}></div>
      </div>
    </div>
  );
};

export default Navbar;
